import './Header.css'
import { Link } from 'react-router-dom';

function Header(props) {
    return (
        <>
            <nav>
                <Link to="/">Home</Link>
                <Link to="/about">About us</Link>
                <h1> Toures App </h1>
            </nav>  </>
    )
}
export default Header;
